import React from "react";
import PizzaCard from "./PizzaCard";

const PizzaCardList = ({ pizzas, category }) => {
  console.log(pizzas);
  const cardComponent = pizzas.map((pizza, index) => {
    return (
      <PizzaCard
        key={pizza.id}
        price={pizza.price}
        sabor={pizza.sabor}
        pizza={pizza}
      />
    );
  });
  return <div className="AllSabores">{cardComponent}</div>;
};

export default PizzaCardList;
